import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './UserActivityEntry.css';

class UserActivityEntry extends React.Component {
  render(){
    return(
      <body>
        <div class = "flex_container">
          <div class = "wrap">
            <p>3 min ago</p>
            <p>10/09/2019</p>
            <p>10:21 am</p>
          </div>
          <div class = "wrap">
          </div>
        </div>
      </body>
    )
  }
}

export default UserActivityEntry;
